+(int)checkLastTransaction
{
    appIapManager* _curIns = [appIapManager sharedInstance];
    NSArray* transactions = [SKPaymentQueue defaultQueue].transactions;
    if (transactions.count > 0)
    {
        SKPaymentTransaction* transaction = [transactions lastObject];
        if (transaction.transactionState == SKPaymentTransactionStatePurchased)
        {
            [_curIns completeTransaction:transaction];
            UIAlertView *alerView = [[UIAlertView alloc] initWithTitle:@"温馨提示"
                                                               message:@"已完成上次订单，稍后请查询账户余额"
                                                              delegate:nil
                                                     cancelButtonTitle:NSLocalizedString(@"关闭",nil)
                                                     otherButtonTitles:nil];
            [alerView show];
            [alerView release];
            return 1;
        }
    }
    return 0;
}

