    [request start];
    //[product release];
}
//<SKProductsRequestDelegate>
//repfinfo
- (void)productsRequest:(SKProductsRequest *)request didReceiveResponse:(SKProductsResponse *)response{
    
    NSArray *myProduct = response.products;
    NSLog(@"Product ID:%@",response.invalidProductIdentifiers);
    NSLog(@"数量: %lu", (unsigned long)[myProduct count]);
    // populate UI
    SKProduct *skProduct = nil;
    for(SKProduct *product in myProduct){
        NSLog(@"product info");
        NSLog(@"SKProduct 描述信息%@", [product description]);
        NSLog(@"产品标题 %@" , product.localizedTitle);
        NSLog(@"产品描述信息: %@" , product.localizedDescription);
        NSLog(@"价格: %@" , product.price);
        NSLog(@"Product id: %@" , product.productIdentifier);
        NSComparisonResult result = [product.productIdentifier caseInsensitiveCompare:iosStr];
        if(result == NSOrderedSame)
        {
            skProduct = product;
        }
    }
    //    SKPayment *payment = nil;
    //    payment = [SKPayment paymentWithProductIdentifier:iosStr];
    SKMutablePayment *payment = [SKMutablePayment paymentWithProduct:skProduct];
    payment.quantity = 1;
    if ([appIapManager getIOSVersion] >= 7.0) {
//        payment.applicationUsername = [_userOrderId copy];
        payment.applicationUsername = [NSString stringWithFormat:@"%s",_userOrderId.c_str()];
    }
    
    [[SKPaymentQueue defaultQueue] addPayment:payment];
    [request autorelease];
}


