-(void) PurchasedTransaction: (SKPaymentTransaction *)transaction{
    
    NSArray *transactions =[[NSArray alloc] initWithObjects:transaction, nil];
    [self paymentQueue:[SKPaymentQueue defaultQueue] updatedTransactions:transactions];
    [transactions release];
}




- (void)paymentQueue:(SKPaymentQueue *)queue updatedTransactions:(NSArray *)transactions
{
    
    for (SKPaymentTransaction *transaction in transactions)
    {
        switch (transaction.transactionState)
        {
            case SKPaymentTransactionStatePurchased:
            {
                [self completeTransaction:transaction];
            }
                break;
                
            case SKPaymentTransactionStateFailed:
            {
                [self failedTransaction:transaction];
            }
                break;
                
            case SKPaymentTransactionStateRestored:
            {
                [self restoreTransaction:transaction];
            }
                break;
            case SKPaymentTransactionStatePurchasing:
                break;
                
            default:
                break;
                
                
        }
    }
}




- (void) completeTransaction: (SKPaymentTransaction *)transaction

{
    
    
    NSString * productIdentifier = transaction.payment.productIdentifier;
    receipt = [[NSString alloc] initWithData:transaction.transactionReceipt  encoding:NSUTF8StringEncoding];
    std::string order = "";
    if (transaction.payment.applicationUsername != nil)
    {
        order = [transaction.payment.applicationUsername UTF8String];
    }
    if ([productIdentifier length] > 0) {
        // yanzheng
        
        if (functionId != 0 )
        {
            std::string strInfo = [receipt UTF8String];
            strInfo= strInfo.append("_1");
            if ([appIapManager getIOSVersion] >= 7.0 && order != "")
            {
                strInfo = strInfo.append("_");
                strInfo = strInfo.append(order);
            }
            cocos2d::LuaBridge::pushLuaFunctionById(functionId);
            cocos2d::LuaBridge::getStack()->pushString(strInfo.c_str());
            cocos2d::LuaBridge::getStack()->executeFunction(1);
            cocos2d::LuaBridge::releaseLuaFunctionById(functionId);
        }
    }
    
    [[SKPaymentQueue defaultQueue] finishTransaction: transaction];
}



