- (void) failedTransaction: (SKPaymentTransaction *)transaction{
    NSLog(@"fail");
    if (functionId != 0 )
    {
        std::string receipt = "0";
        std::string strInfo = receipt;
        strInfo= strInfo.append("_0");
        std::string order = "";
        if (transaction.payment.applicationUsername != nil)
        {
            order = [transaction.payment.applicationUsername UTF8String];
        }
        if ([appIapManager getIOSVersion] >= 7.0 && order != "")
        {
            strInfo = strInfo.append("_");
            strInfo = strInfo.append([transaction.payment.applicationUsername UTF8String]);
        }
        cocos2d::LuaBridge::pushLuaFunctionById(functionId);
        cocos2d::LuaBridge::getStack()->pushString(strInfo.c_str());
        cocos2d::LuaBridge::getStack()->executeFunction(1);
        cocos2d::LuaBridge::releaseLuaFunctionById(functionId);
    }
    [[SKPaymentQueue defaultQueue] finishTransaction: transaction];
    
    
}
